import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import { useDispatch } from 'react-redux';
import {  getPostById } from '../JS/Actions/add';

const AnnonceDetail = () => {
  const { id } = useParams();
  const [annonce, setAnnonce] = useState(null);

  const dispatch = useDispatch()

  useEffect(() => {
    // Fetch the announcement details based on the ID from the URL
    dispatch(getPostById(id))
    set
  }, [id, dispatch]);

  if (!annonce) {
    // Display a loading message while fetching data
    return <p>Loading...</p>;
  }

  return (
    <div>
    <h2>{annonce && annonce.name}</h2>
    <p>Category: {annonce && annonce.category}</p>
    <p>Picture: {annonce && annonce.picture}</p>
    <p>Description: {annonce && annonce.description}</p>
    <p>Coordinates: {annonce && annonce.coordinates}</p>
  </div>
  );
};

export default AnnonceDetail;
